import  Trending  from './components/Trending';
import Popular from './components/Popular';
// import Loading from './components/Loading';


function App() {
  return (

         <div class=" bg-center h-[200rem] "    style={{backgroundImage: `url(${background})`}}>
           <img src="./images/blob_https___play.hbomax.com_159b613a-a622-48cb-94bd-64029ab6f706" alt="" />     



           <Navbar></Navbar>
           <Home></Home>
            <Trending></Trending>
            <Popular></Popular>
           <Footer></Footer> 

   </div>
  );
}

export default App;
